import React from 'react';

class Children extends React.Component {
    onClickHidden = () => {
        alert('me');
    };
    render() {
        const { listClass } = this.props;

        return (
            <div>
                <div>
                    <span onClick={this.onClickHidden()}> hidden</span>
                </div>
                <div>
                    {listClass.map((item) => {
                        return (
                            <div
                                key={item.name}
                                className={item.age > 18 ? 'red' : 'blueviolet'}
                            >
                                <p>my name {item.name}</p>
                                <p> age {item.age}</p>
                            </div>
                        );
                    })}
                </div>
            </div>
        );
    }
}
export default Children;
